import React from 'react';
import dynamic from 'next/dynamic'
const rdfetch = require('@rdfjs/fetch');
/*const Map = dynamic(() => import('../components/Map'), {
    ssr: false,
    loading: () => 'Loading...'
});*/


const Test= props => (

    <React.Fragment>
        <p>Museaale muuseumis: {props.count}</p>
        <p>Museaale valikus: {props.choice}</p>
        <p>Museaale s√ºndmusega: {props.countEvent}</p>

    </React.Fragment>
);



   Test.getInitialProps = async function getInitialProps (context) {

       async function hasHigher(link) {
           const res = await rdfetch(`${link}`, {
               headers: {
                   accept: 'application/rdf+xml'
               }
           });
           const dataset = await res.dataset();
                //
           for (const quad of dataset) {
               if(quad.object.value == "http://www.cidoc-crm.org/cidoc-crm/P127_has_broader_term" ) {
                   console.log(`subjekt: ${quad.subject.value}, predikaat: ${quad.predicate.value} objekt: ${quad.object.value}`)
               }


       }
       }


       async function isTypeEvent(link) {
               const res = await rdfetch(`${link}`, {
                   headers: {
                       accept: 'application/rdf+xml'
                   }
               });
               if(res){
                   const dataset = await res.dataset();
                   if(dataset) {
                       for (const quad of dataset) {
                           if(quad.object.value == "http://opendata.muis.ee/thesaurus/61/11273" ) {
                               return true;
                           }
                        /*   else{
                               hasHigher(quad.object.value);
                           }*/

                       }

                   }

               }


       }

       async function hasEvent(link) {
               const res = await rdfetch(`${link}`, {
                   headers: {
                       accept: 'application/rdf+xml'
                   }
               });
               const dataset = await res.dataset();

               for (const quad of dataset) {
                   if (quad.predicate.value == "http://www.cidoc-crm.org/cidoc-crm/P12_occurred_in_the_presence_of" ) {
                       { let isType = await isTypeEvent(quad.object.value);
                           if(isType) {
                               return true;
                           }

                       }


                   }

               }
           }

       let count = 0;
       let countEvent = 0;
       const choice = 50;
       const array = [];

        const value = await fetch('http://www.muis.ee/rdf/objects-by-museum/34191')
           .then(res => res.dataset())
           .then(dataset => {
               for (const quad of dataset) {
                   if(quad.predicate.value == "http://www.cidoc-crm.org/cidoc-crm/P46_is_composed_of")
                   { array.push(quad.object.value);
                       count ++

                   }
               }
           })
           .catch(err => console.error(err));

/*       const res = await rdfetch('http://www.muis.ee/rdf/objects-by-museum/34191', {
            headers: {
                accept: 'application/rdf+xml'
            }
        });
       const dataset = await res.dataset();
       let count = 0;
       let countEvent = 0;
       const choice = 50;
       const array = [];
       for (const quad of dataset) {
            if(quad.predicate.value == "http://www.cidoc-crm.org/cidoc-crm/P46_is_composed_of")
            { array.push(quad.object.value);
                count ++

            }


      }*/

      for (let x = 0; x<choice; x++) {
           { let hasEv = await hasEvent(array[x]);
               if(hasEv) {
                   countEvent++
               }

           }


       }




       return {count, choice, countEvent};
    };




export default Test
